INSERT INTO `pendaftar` (`id_pendaftar`, `nrp`, `nama`, `ipk`, `jurusan`, `fakultas`, `id_line`, `divisi1`, `divisi2`, `alamat_sekarang`, `kota_sekarang`, `pengalaman_panit`, `panit_sekarang`, `motivasi`, `filepath_skkk`, `filepath_transkrip`, `pertanyaan_1`, `pertanyaan_2`, `pertanyaan_3`, `jadwal_wawancara`, `pewawancara`, `status`) VALUES
(5, 'c14200010', 'GLENN STEVEN SANTOSO', 3.63, 'Teknik Informatika', 'Teknologi Industri', 'glennsteven', 2, 8, 'Citra Garden C1-37', 'Kota Surabaya', 'PAW PPS Intel 2020/2021\r\nPAW PPS Intel 2021/2022\r\nDivisi Perkapman BEWCT\r\nDivisi IT Hut-LKKBM', 'PAW PPS Intel 2021/2022\r\nDivisi IT Hut-LKKBM', 'Mengembangkan skill front-end dan back-end', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_5-6f00790eaa26af4772b8219a0f406121.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_5-6f00790eaa26af4772b8219a0f406121.png', 'Ya', 'Ya, 50000', 'Tidak', 176, NULL, 0),
(6, 'c14200105', 'NATHANAEL KITO WIJAYA', 3.29, 'Teknik Informatika', 'Teknologi Industri', 'nathanael.kito', 2, 6, 'jl.mendut gang 10 no 11', 'banyuwangi', 'WGGP informatika Div. Keamanan\r\nPengmas BEWCT Div. Materi', 'Pengmas TERRA Div.Sekret', 'ingin mencari pengalaman dan berinteraksi dengan banyak orang', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_6-957abdd977f318af997520b1f06eae4b.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_6-957abdd977f318af997520b1f06eae4b.png', 'Ya', 'Ya, 500000', 'Tidak', 650, NULL, 0),
(7, 'c14200085', 'TIFFANY RACHEL', 3.28, 'Teknik Informatika', 'Teknologi Industri', 'tiffrachel14', 2, 5, 'Kutisari Besar no 8, Surabaya', 'Surabaya', '-- Organisasi ---\r\nMagang HIMAINFRA 2020/2021 - Human Resource Departement\r\nFungsionaris HIMAINFRA 2021/2022 - Public Relation Development\r\n\r\n\r\n---- Panitia----\r\n\r\n# Anggota #\r\nTranskaman -  Bidang Seni Budaya (Spetrakuler 2021)\r\nAcara - Be Creative 2021 (Pengmas HIMAINFRA)\r\nKeamanan - WGG Prodi Infor/SIB/DSA 2021\r\nMentor - Bank Panitia (Informatics Committee Club 2021)\r\nDoa pemerhati - Intel PPS 2021\r\nSurround Team - UKM VG 2021/2022\r\nPublic Relation - LKMM-TD 32 \r\n\r\n#BPH#\r\nKetua Panitia - Be Excellent with Computational Thinking (Pengmas HIMAINFRA)\r\nSekretaris - HUT LK-KBM 2021', 'HUT LK-KBM 2021, LKMM-TD 32', 'Ingin menambah pengalaman baru dan relasi ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_7-766a0aed0c2816269e7402f747079726.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_7-766a0aed0c2816269e7402f747079726.png', 'Ya', 'Ya, 30000', 'Tidak', 329, NULL, 0),
(8, 'd12210093', 'RISTA VALENSIA SUSENO', 0, 'Akuntansi Pajak', 'Bisnis dan Ekonomi', 'rista_val55', 6, 8, 'Jl. Slamet Riyadi Km 3', 'Rembang', 'Panitia penjualan Bakti Sosial SSV 2019', '-', 'Menambah pengalaman, belajar mengatur waktu, memperluas relasi pertemanan, dan belajar tanggung jawab dalam bekerjasama atau berkomunikasi dengan orang lain.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_8-39440ffce748f202b524894ebb58ca33.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_8-39440ffce748f202b524894ebb58ca33.jpg', 'Ya', 'Ya, 100000', 'Tidak', 410, NULL, 0),
(9, 'c14200061', 'ADRIAN WINAYA', 3.84, 'Teknik Informatika', 'Teknologi Industri', 'adrianwinayahardi2', 2, 8, 'Jl Raya Kupang Baru 22', 'Surabaya', '- BEM (dept. FND)\r\n- BEWCT (div. acara)\r\n- IRGL (div. game)\r\n- WGG (div. peran)', 'BEM', 'Ingin belajar lebih banyak tentang web design', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_9-2b8dfca2d04a861b360fa36347042bc9.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_9-2b8dfca2d04a861b360fa36347042bc9.jpg', 'Ya', 'Ya, 50000', 'Tidak', 523, NULL, 0),
(10, 'd11210381', 'CHRISTIAN PUTRA', 0, 'Manajemen Bisnis', 'Bisnis dan Ekonomi', 'chriatianputra07', 4, 6, 'Ruko citra city r-2 , sarirogo , sidoarjo', 'sidoarjo', 'belum ada', 'belum ada', 'ingin ikut berpartisipasi untuk menjadi bagian spetrakuler 2022 , yang menyelenggarakan lomba-lomba , menurut saya itu adalah acara yang sangat bagus untuk mencari potensi-potensi yang ada , sehingga saya sangat termotivasi sekali untuk ingin ikut serta menjadi panitia , selain itu saya juga bisa menambah pengalaman dan menambah relasi , selain itu saya juga dapat mengasah skill dalam kerjasama , keterampilan dan juga mengasah mental', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_10-049912028e96fab3b907c64d8d703174.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_10-049912028e96fab3b907c64d8d703174.jpg', 'Ya', 'Ya, 75000', 'Ya, beberapa teman saya membuka usaha online , seperti @grld.jersey , @sfstore_id_  , @sfjerseystore , @dimsumkepoo', 670, NULL, 0),
(11, 'c14210206', 'LEONARDO NICKHOLAS ANDRIANTO', 0, 'Sistem Informasi Bisnis', 'Teknologi Industri', 'leon111718', 6, 8, 'Cermee, Bondowoso', 'Bondowoso', 'Peserta Bank Panitia Informatika', '-', 'Motivasi saya untuk tergabung dalam kepanitiaan ini yaitu ingin memperbanyak pengalaman organisasi saya mengingat pengalaman organisasi saya masih sedikit. Selain itu, saya juga ingin meningkatkan softskill saya dan juga ingin belajar bekerja sama dalam suatu kepanitiaan. Saya juga ingin belajar untuk menjadi orang yang lebih bertanggung jawab terhadap keputusan yang saya ambil.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_11-71f8b0a6ca946a5c9543bf82916a9ab1.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_11-71f8b0a6ca946a5c9543bf82916a9ab1.png', 'Ya', 'Ya, 100000', 'Tidak', 63, NULL, 0),
(12, 'b12210087', 'IVAN REAGAN PRASETYO', 0, 'Arsitektur', 'Teknik Sipil dan Perencanaan', 'ivanreagan', 7, 8, 'Manyar Tirtoyoso Selatan 4/24 EE-1', 'Surabaya', '-', 'Archeffect', 'Mengebangkan softskill dan hardskill saya, seperti mencari pengalaman berorganisasi dan\r\nmeningkatkan kerjasama dengan satu organisasi', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_12-1a1278a6bd06465f371f808d32226042.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_12-1a1278a6bd06465f371f808d32226042.jpg', 'Ya', 'Ya, 100000', 'Tidak', 312, NULL, 0),
