(20, 'd11210053', 'GERTRUDIS GRACIELA SOEHARDI', 0, 'Manajemen Pariwisata', 'Bisnis dan Ekonomi', 'gertrudisgraciela_s', 8, 2, 'Jalan Taman Asri Utara P39, Pondok Tjandra Indah', 'Sidoarjo', '\'-\'', 'Panitia TREX 2021 divisi PERKAPMAN', 'Karena saya ingin menambah relasi dengan orang-orang baru, saya juga ingin mempelajari hal-hal baru dalam kepanitiaan, saya juga ingin menjadi lebih aktif dalam kegiatan-kegiatan kepanitiaan, dan saya juga suka dengan olahraga jadi saya tertarik untuk ikut kepanitiaan yang berhubungan dengan olahraga.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_20-cce02a145c939cb276f1cad6f2fe1e56.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_20-cce02a145c939cb276f1cad6f2fe1e56.png', 'Ya', 'Ya, 150000', 'Tidak', 367, NULL, 0),
(21, 'd12210048', 'WIDYANTI LIMANTO ', 0, 'Akuntansi Bisnis', 'Bisnis dan Ekonomi', 'limanto999', 4, 5, 'Jalan belibis pv 27 rewwin ', 'Sidoarjo', 'Sponsor Semnas 21', '- ', 'Ingin menambah wawasan dan juga relasi yang positif ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_21-b71d9ddfd12c7e7d312d94b4b487b255.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_21-b71d9ddfd12c7e7d312d94b4b487b255.jpg', 'Ya', 'Tidak', 'Tidak', 139, NULL, 0),
(22, 'd11210069', 'CATHLEEN NATANIA SALIM', 0, 'Manajemen Pariwisata', 'Bisnis dan Ekonomi', 'cathleenns', 6, 8, 'Perum Galaxi Bumi Permai tahap 2 blok J1/50', 'Surabaya', '-', '-', 'Aku ga pernah mengikuti kegiatan kepanitiaan dan penasaran gimana rasanya ikut panitia suatu acara. Temanku sering cerita pengalamannya dia di kepanitiaan, susah senangnya dia saat ikut kepanitiaan itu. Dia sering ngeluh sama aku tentang kepantiaannya tapi keliatan kalo dia itu menikmati banget hal-hal yang terjadi, susah tapi serunya tugas/tantangan yang dihadapi, dan rasa puas saat acara panitia itu berjalan sukses. Mendengar cerita-ceritanya dia, aku merasa kalo kuliah cuman belajar aja itu ga seru, beda sama pemikiranku dulu saat SMP-SMA. Oleh karena itu, aku ingin banget mengikuti kepanitian Spetrakuler ini dan mau juga rasain apa yang temenku rasain saat ikut kepanitiaan.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_22-5767fe5acdb67baddeee8f3749382308.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_22-5767fe5acdb67baddeee8f3749382308.png', 'Ya', 'Ya, 200000', 'Tidak', 297, NULL, 0),
