(64, 'd12210054', 'MARIA GRACELLA', 0, 'Akuntansi Bisnis', 'Bisnis dan Ekonomi', 'cellalimn', 3, 6, 'Jl. Ngagel Jaya Tengah 97', 'Surabaya', '-', '-Talkshow Anti Elitism series 2021', 'Meningkatkan kemampuan bekerja sama dalam sebuah kepanitiaan, memperluas jaringan pertemanan dan network, menambah pengalaman serta skill berkomunikasi, menyelesaikan masalah, dan manajemen waktu.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_64-c956216f814f1167afa5222bf7f301bc.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_64-c956216f814f1167afa5222bf7f301bc.jpg', 'Ya', 'Tidak', 'Tidak', 216, NULL, 0),
(65, 'g11210001', 'CORNELIA VALENCIA METANOIA', 0, 'Pendidikan Guru Pendidikan Anak Usia Dini', 'Keguruan dan Ilmu Pendidikan', '2021', 6, 3, 'CITRA FAJAR GOLF ATS BLOK B 25, SIDOARJO', 'SIDOARJO', 'Mengikuti tim persekutuan doa SMA, panitia buku kenangan, pengmas fakultas.', 'Panitia PPS, panitia lomba microteaching untuk 2022', 'Kegiatan kepanitiaan ini merupakan salah satu event yang cukup besar dan pasti memiliki beberapa hal baru yang tidak saya dapatkan di kepanitiaan sebelumnya. Maka dari itu, saya ingin mendapatkan pengalaman dan belajar hal baru, serta sekaligus ingin beradaptasi dengan lingkungan perkuliahan dan pertemanan dengan mengikuti kepanitiaan. Saya harap saya bisa bekerja lalu bertumbuh disini.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_65-73184d29ed5bfa124e02df40dd3fb830.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_65-73184d29ed5bfa124e02df40dd3fb830.png', 'Ya', 'Ya, 150000', 'Tidak', 649, NULL, 0),
