(67, 'c14200173', 'KEZIA ELIM TALI', 3.38, 'Teknik Informatika', 'Teknologi Industri', 'Kezia0410', 6, 4, 'Jln. Mohammad Hatta no. 23 ', 'Kota Kupang', 'Divisi Peran di WGG 2021\r\nDivisi Sekret di acara Petra Online Festival & Petra Online Market 2021', 'HIMAINFRA (Dept. Internal Development) -> Ketua Persekutuan Program Studi INTEL 2021/2022\r\nKepala Bidang 2 + Koor Sekhum acara HUT LK-KBM 2021', 'Saya secara pribadi tertarik untuk bergabung dalam kepanitiaan / organisasi untuk melayani sesama kita. Selain itu, dari kepanitiaan ini, saya merasa bahwa saya akan memiliki kesempatan untuk belajar mengembangkan potensi dan softskill yang saya miliki, serta belajar berelasi dengan orang banyak.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_67-98f851ca42530101d118dd3e681b82b9.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_67-98f851ca42530101d118dd3e681b82b9.png', 'Ya', 'Ya, 50000', 'Tidak', 434, NULL, 0),
