(149, 'd11210449', 'JESSIE CLARISSA', 0, 'Manajemen Keuangan', 'Bisnis dan Ekonomi', 'jessie_clarissa14', 6, 8, 'Jl. Karang Asem VB no. 23', 'Surabaya', 'Bankpan 2021-Koordinator Divisi Sekretariat\r\nPanitia Retreat Gereja (SMA)', '-', 'Saya ingin menambah wawasan, pengalaman dan koneksi baru agar dapat bertumbuh menjadi individu yang lebih baik. Selain itu dengan adanya koneksi baru yang bisa didapatkan, saya juga dapat belajar dari pengalaman dan cerita orang lain.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_149-a6c937da122f2cfef01f4ef1d9a44626.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_149-a6c937da122f2cfef01f4ef1d9a44626.jpg', 'Ya', 'Ya, 50000', 'Tidak', 621, NULL, 0),
(150, 'c14200197', 'AMELIA SYATRIADI', 3.95, 'Sistem Informasi Bisnis', 'Teknologi Industri', 'amelia_syatriadi', 2, 6, 'Jl. Raya Klampis Semolo Timur No. 2A', 'Surabaya', '- Anggota Departemen Reporter Online Persma 2020/2021\r\n- Anggota Divisi Peran WGG 2021\r\n- Anggota Divisi Pubsekhum IRGL 2021', '- Sekretaris Artizen 2022\r\n- Bendahara IRGL 2022\r\n- Koordinator Departemen Reporter Online Persma 2021/2022', 'Saya ingin belajar, menambah relasi, dan mendapatkan pengalaman baru, khususnya dalam divisi IT.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_150-44e75c0565af55bb37f0a1e5a31a8df0.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_150-44e75c0565af55bb37f0a1e5a31a8df0.png', 'Ya', 'Ya, 75000', 'Tidak', 647, NULL, 0);
