(151, 'd11210118', 'BRENDA MELLISA SANTOSO', 0, 'Manajemen Perhotelan', 'Bisnis dan Ekonomi', 'brendams', 8, 3, 'Gubeng Kertajaya 6a no 38a', 'Surabaya', '-', '-', 'Acara ini sangat menarik perhatian saya karena dari acara ini kita bisa lebih mengeksplor lebih banyak lagi bakat dari setiap mahasiswa. Selain itu, saya juga tertarik untuk menjadi pengurus perlombaan seperti Spetrakuler ini. Tak hanya itu saya juga ingin bisa berkontribusi lagi dalam Univetrsitas Kristen Petra dan mengembangkan softskills dan hardskills saya di acara Spetrakuler ini.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_151-db0399bc8915b20effc5e453ecacfb51.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_151-db0399bc8915b20effc5e453ecacfb51.jpg', 'Ya', 'Ya, 150.000', 'Tidak', 763, NULL, 0),
