(154, 'c14200133', 'VERELYN CHRESTELLA JAOLIS', 3.26, 'Sistem Informasi Bisnis', 'Teknologi Industri', 'verelynchrestellass', 6, 8, 'Jalan Musang ', 'Makassar', 'Spetrakuler 2021 Bidang BOM - Divisi Virtual Run and Cycling ', 'Studi Ekskursi 2021 - Divisi Sekretariat ', 'Motivasi saya dalam mengikuti Spetrakuler adalah karena ingin menambah pengalaman baru, menambah relasi dan mengasah softskill dan hardskill saya.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_154-c66a8b022fb6f2a13840a46da23e56ad.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_154-c66a8b022fb6f2a13840a46da23e56ad.png', 'Ya', 'Ya, 150.000', 'Tidak', 610, NULL, 0),
(155, 'c14210112', 'PRICILLIA SILFANY MARGO', 0, 'Data Science Analytics', 'Teknologi Industri', 'pricilliasilfanyy', 6, 4, 'Kalijudan Madya 1/50', 'Surabaya', '-', '-', 'Ingin menambah pengalaman dan relasi, melatih softskill dan hardskill, dan berkontribusi dalam kegiatan ini.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_155-c4f32377c0c2984ee1f33bc34fa52536.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_155-c4f32377c0c2984ee1f33bc34fa52536.jpg', 'Ya', 'Ya, 50000', 'Tidak', 834, NULL, 0),
