(158, 'e12210162', 'CHARLENNE CHAY', 0, 'Desain Komunikasi Visual', 'Seni dan Desain', 'charlenne_2103', 6, 3, 'Central Park Klampis Regency kav.67, Jalan Semolowaru', 'Surabaya', 'Petra : BEACON IBE Competition(sekretariat)\r\nGereja : \r\nTeam acara 3 kali, Stage manager di acara natal, sekretariat, sekretaris, social media manager, usher beberapa kali, hospitality person.', 'sedang mengikuti Desporev di divisi merch, sedang menjadi panitia di gereja dalam divisi team acara', 'Motivasi saya mengikuti acara ini adalah untuk belajar lebih lagi dan juga untuk mendapat pengalaman. Setiap kepanitiaan memiliki pelajaran dan experience yang berbeda, sehingga saya ingin mendapatkan lebih lagi experience juga ditambah dengan bertemu dengan orang orang baru. Saya berharap saya dapat belajar banyak dan menjadi orang yang lebih baik dalam segi soft skill, hard skill dan a better person overall. ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_158-524ae99bb39ec42ff464c865fca6c43b.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_158-524ae99bb39ec42ff464c865fca6c43b.png', 'Ya', 'Ya, 150000', 'Tidak', 832, NULL, 0),
