(160, 'd12210038', 'CLOVIZ NOZA ONGGARA', 0, 'Akuntansi Pajak', 'Bisnis dan Ekonomi', 'cloviznoza', 8, 3, 'Mulyosari Prima 1 no 51', 'Surabaya', '_', '_', 'Untuk menambah pengalaman kepanitiaan saya, sekaligus mengasah hard skill dan soft skill saya', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_160-1b0cfcfe9f71ee4ea6d0215fa4fbc9fa.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_160-1b0cfcfe9f71ee4ea6d0215fa4fbc9fa.jpg', 'Ya', 'Ya, 100000', 'Tidak', 806, NULL, 0),
