(162, 'c13210011', 'KENNETH ELBERT', 0, 'International Business Engineering', 'Teknologi Industri', 'inikenneth03', 8, 6, 'rungkut asri barat XIV/04', 'surabaya', '1. Divisi Sekretariat CEO Talk Mapping Out Your Technology\r\nCareer\r\n2. Head Committee of Product Retrospective', '1. Divisi sekretariat HOW TO BUILD AN END TO END NLQ SOLUTIONS WITH AWS SERVICES', 'mencari relasi bersama teman', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_162-7d51a395312306cfa56859cbbb87cdbd.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_162-7d51a395312306cfa56859cbbb87cdbd.png', 'Ya', 'Ya, 150000', 'Tidak', 757, NULL, 0),
(163, 'd11200176', 'REVIN PHILIP JONATHAN', 3.35, 'Manajemen Perhotelan', 'Bisnis dan Ekonomi', 'revinphilip10', 8, 6, 'Jl. Raya asembagus No.40, Kab. Situbondo', 'Situbondo', 'Panitia perkap BIM\r\nPanitia perkap Creation 2021\r\nPelayanan gereja', '-', 'Ingin melayani di bagian Perkap lagi di spetra supaya mendapat banyak pengalaman dan menambah relasi dengan orang baru. Memperdalam skill dan melatih pertanggungjawaban sebagai panitia spetra', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_163-273f3a4d548feb01f03cf6defec3e9a2.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_163-273f3a4d548feb01f03cf6defec3e9a2.jpg', 'Ya', 'Ya, 100.000', 'Tidak', 759, NULL, 0),
