(165, 'c13210067', 'TAMARA REGINA DARMAWAN', 0, 'International Business Engineering', 'Teknologi Industri', 'tamararegina', 6, 3, 'Jln. Kebudayaan 18 Denpasar Bali', 'Denpasar', '1) CEO of Mapping Out Your Technology Career Webinar - Divisi Acara (MC)\r\n2) FTI Colloquium - Divisi Acara (MC)\r\n3) Product Retrospectives Webinar - Divisi Sekretariat \r\n4) Industrial Competition 2021 - Divisi Sekretariat', '1) Panitia Alumni Story - Divisi Acara (MC)\r\n2) How to build an End to End NLQ Solution with Amazon Web Services - Head of Webinar', 'Saya ingin mengikuti Spetrakuler 2022 untuk menambah relasi, menambah pengalaman baru, dan menguji kemampuan saya. Saya yakin dengan mengikuti Spetrakuler akan membuka pintu kesempatan yang banyak untuk saya untuk bisa berproses dan berkembang menjadi individual yang lebih baik. ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_165-0537a46e79e57ff6169413f63104c49a.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_165-0537a46e79e57ff6169413f63104c49a.png', 'Ya', 'Ya, 150000', 'Tidak', 672, NULL, 0),
(166, 'd12210148', 'WILSON ANDREW', 0, 'Akuntansi Pajak', 'Bisnis dan Ekonomi', 'w1663', 8, 4, 'Jalan Daeng Tata Raya Perumahan Permata Mutiara Permata 4 blok F no. 42', 'Makassar, Sulawesi Selatan', 'Simulasi Bankpan 2021', 'TAX ACCOUNTING SPORT COMPETITION (TASCO)', 'saya ingin belajar banyak dari kepanitian ini karena sangat berguna bagi kehidupan yang akan datang serta saya dapat menambah pengalaman serta relasi ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_166-6025cfa04adcf353c6048408e87f0bec.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_166-6025cfa04adcf353c6048408e87f0bec.jpg', 'Ya', 'Ya, 300000', 'Ya, Club Mineral Water Makassar', 767, NULL, 0),
(167, 'c14200058', 'HANZEL TANGKAR', 3.11, 'Sistem Informasi Bisnis', 'Teknologi Industri', 'hanzel1202', 8, 2, 'Jl. Taman Dieng no.4', 'Malang', 'Perkap dalam event Informates Corner', 'Informates Corner', 'Saya ingin merasakan rasanya menjadi panitia di acara yang lebih besar', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_167-11551f219cc59699fe858d7360fca7c3.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_167-11551f219cc59699fe858d7360fca7c3.png', 'Ya', 'Ya, 50000', 'Tidak', 764, NULL, 0),
(168, 'd11210162', 'JAMES VALDI', 0, 'Manajemen Perhotelan', 'Bisnis dan Ekonomi', 'jamesvaldi01', 6, 5, 'Jl. Manyar Kertoadi No. 44', 'Surabaya', 'From Zero to Hero', 'tidak ada', 'Saya ingin belajar lebih banyak lagi hal dari kepanitiaan yang lebih besar. Saya juga ingin menjadi panitia di divisi yang lain sehingga saya tahu caranya dan bisa merasakannya.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_168-6acd2ff476021ef749c93e202d4f8e9e.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_168-6acd2ff476021ef749c93e202d4f8e9e.png', 'Ya', 'Tidak', 'Tidak', 824, NULL, 0),
(169, 'd11210074', 'ERIC SANJAYA', 0, 'Manajemen Perhotelan', 'Bisnis dan Ekonomi', 'mekongbali', 7, 8, 'Wonorejo 1  No. 82-84', 'Surabaya', 'panitia mos saat smp', '_', 'ingin mencari pengalaman baru di dunia perkuliahan ini dan mencari relasi baru.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_169-6d8ff11b86f794c7c92c3a121d730396.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_169-6d8ff11b86f794c7c92c3a121d730396.png', 'Ya', 'Ya, 200.000', 'Tidak', 750, NULL, 0),
(170, 'c14200178', 'BILLY CUAN A', 3.66, 'Teknik Informatika', 'Teknologi Industri', 'billy_cuan', 2, 8, 'Jl Siwalankerto VIII cc-3', 'Surabaya', 'MLBB BOM, PDD PPS, Peran WGG, Panitia pelaksana Perkap Bankpan', 'IT LKMM-TD', 'Supaya bisa mengembangkan kemampuan dalam kepanitiaan, khususnya IT, supaya menjadi lebih berpengalaman', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_170-e6d48c8984c20cdd0db48296a1a34a4a.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_170-e6d48c8984c20cdd0db48296a1a34a4a.png', 'Ya', 'Ya, 100000', 'Tidak', 648, NULL, 0),
(171, 'd12210096', 'CHRISTIAN BAGAS PURNOMO', 0, 'Akuntansi Pajak', 'Bisnis dan Ekonomi', 'bagdos', 6, 8, 'Jalan Pakis Sidorejo II no 8', 'Surabaya', 'pernah ikut Persekutuan doa , ikut karang taruna , Simulasi Himajaktra', '-', 'Ingin mencari pengalaman dan pelajaran baru di kepanitian dan mencari teman - teman baru,\r\nkarena acara spetrakuler merupakan salah satu acara besar yang ada di petra.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_171-64e93041eda6d72f96396c943042912d.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_171-64e93041eda6d72f96396c943042912d.jpg', 'Ya', 'Ya, 150000', 'Tidak', 833, NULL, 0),
(172, 'c12210023', 'MATTHEW ANDREW', 0, 'Teknik Mesin', 'Teknologi Industri', 'matthewandrew11', 8, 6, 'Perum Bumi Citra Fajar Jl. Sekawan Elok Raya A2, No. 64, Sidoarjo', 'Kab. Sidoarjo', '-', '-', 'Karena saya tertarik dan bangga jika bisa bergabung dalam kepanitiaan besar seperti Spetrakuler, saya ingin belajar dan mendapat pengalaman baru, mengasah skill, kerjasama, dan komunikasi', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_172-777fc7df0dbbace45fedb655f30c2fc5.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_172-777fc7df0dbbace45fedb655f30c2fc5.jpg', 'Ya', 'Ya, 25000', 'Tidak', 816, NULL, 0),
(173, 'd11200394', 'AUDREY THIENDA', 3.17, 'Manajemen Bisnis', 'Bisnis dan Ekonomi', 'atjisfine', 3, 5, 'Jl.said perintah Ruko no.2', 'Ambon', 'divisi acara life enrichment grace 2021, koor acara webinar himamatra x pameo 2021', '-', 'ingin belajar serta menjadi bagian dari acara besar spetrakuler, dan menambah pengalaman juga pengalaman wawasan', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_173-f1242e58757686a6d052cf17d1209f95.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_173-f1242e58757686a6d052cf17d1209f95.jpg', 'Ya', 'Ya, 200000', 'Tidak', 879, NULL, 0),
(174, 'c14200132', 'NICO TANTOROPUTRO', 2.84, 'Teknik Informatika', 'Teknologi Industri', 'nicotantoroputro', 2, 8, 'Siwalankerto VIII CC3, Surabaya, Gayungan, Jawa Timur 60234', 'Surabaya', 'Peserta Bank Panitia ICC', '-', 'Ingin menambah pengalaman dan mengasah kemampuan di bidang organisasi dan kepanitiaan', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_174-2becab7a5f532d23f3e83e80322a4057.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_174-2becab7a5f532d23f3e83e80322a4057.png', 'Ya', 'Ya, 50000', 'Tidak', 803, NULL, 0),
(175, 'e12210033', 'FELLY JUVENCIA', 0, 'Desain Komunikasi Visual', 'Seni dan Desain', 'fellyjuvenciaa27', 5, 3, 'Bratang Gede 113', 'Surabaya', '-', 'Artizen', 'Ingin menambah relasi baru di luar jurusan dan mendapat pengalaman baru', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_175-41727a199c0a104cedf4ece929aa3325.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_175-41727a199c0a104cedf4ece929aa3325.jpg', 'Ya', 'Ya, 150000', 'Tidak', 870, NULL, 0),
(176, 'c14210109', 'ELLA ARMINTA', 0, 'Sistem Informasi Bisnis', 'Teknologi Industri', 'ellaarminta15', 6, 5, 'Pakuwon city taman mutiara c3 no 40', 'Surabaya', 'panitia dalam lomba glocup 2019. menjadi orang yang menyocokan data peserta lomba.waktu offline.', 'Anggota persma div it. Anggota inbullz it.', 'Ingin mengenal dan berkerjasama dengan tim. ingin menambah pengalaman organisasi terutama divisi sekret. ingin belajar cara mengelola data dan menerapkan ilmu yang sudah dipelajari dalam spetra. ingin mengenal orang-orang baru. ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_176-8bae51ab9bcc1183919d6e3f0773fddd.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_176-8bae51ab9bcc1183919d6e3f0773fddd.png', 'Ya', 'Ya, 15000', 'Tidak', 825, NULL, 0),
(177, 'd11210059', 'LAZARO BATIGOL LAUWONO', 0, 'Manajemen Keuangan', 'Bisnis dan Ekonomi', 'lazarolauwono', 6, 5, 'Simo Pomahan 2 Ruko C02', 'Surabaya', '-', '-', 'Bisa membantu orang-orang menyalurkan bakat dan minat mereka, serta untuk menjadi pribadi yang lebih produktif.', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_177-deec85a8cbb0d8bb899e69e93cfb5f67.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_177-deec85a8cbb0d8bb899e69e93cfb5f67.jpg', 'Ya', 'Ya, 100000', 'Tidak', 826, NULL, 0),
(178, 'e12210166', 'OLIVIA SUGIANTO', 0, 'Desain Komunikasi Visual', 'Seni dan Desain', 'olivia132', 6, 5, 'Griya Asri G4 No. 32, Pakuwon City', 'Surabaya', 'Panitia dokumentasi acara (SMA)', '-', 'Saya ingin menambah pengalaman dalam kepanitiaan dan memperluas relasi pertemanan', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_178-75ffad3dd5f3fa220100b797820c914f.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_178-75ffad3dd5f3fa220100b797820c914f.jpg', 'Ya', 'Ya, 150000', 'Tidak', 827, NULL, 0),
(179, 'c13200020', 'FREDERICK FEBRIAN ANGKA WIDJAJA', 2.95, 'Teknik Industri', 'Teknologi Industri', 'frederickfebrian2318', 8, 6, 'Rungkut Asri Barat VII no 1', 'Surabaya', '\'_\'', '\'_\'', 'saya ingin menchallenge diri saya sendiri dengan lingkungan yang baru. untuk sekarang kegiatan yang menurut saya dapat membuat saya keluar dari zona nyaman saya adalah menjadi panitia acara spetrakuler. ', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_179-8161a0156d2d48a7153a0b1cc6ef0318.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_179-8161a0156d2d48a7153a0b1cc6ef0318.png', 'Ya', 'Tidak', 'Tidak', 836, NULL, 0),
(180, 'e12210154', 'NATALIE MARGARETHA', 0, 'Desain Komunikasi Visual', 'Seni dan Desain', 'natzMargaretz', 3, 5, 'Alam Hijau E5/12, Citraland', 'Surabaya', 'STATION 2021\r\nOMK', '-', 'Menjadi lebih bijak dan bertanggung jawab, lebih mampu mengatasi dan menghadapi masalah, belajar mengatur waktu, punya pengalaman baru, meningkatkan kemampuan berkomunikasi, serta menambah relasi', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_180-a7f31071a5f3d578446add1662a6413c.jpg', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_180-a7f31071a5f3d578446add1662a6413c.jpg', 'Ya', 'Ya, 200000', 'Tidak', 878, NULL, 0),
(181, 'c14210129', 'JEANNE ANGELINE SIEMON', 0, 'Teknik Informatika', 'Teknologi Industri', 'jeanneangelines', 3, 2, 'Villa Bukit Regency 3, PE 7/20', 'Surabaya', 'Panitia Inti Rally Games "Tic Tac Shoe"\r\nSie Acara (Games) "Santa\'s Arrival"\r\nSie Publikasi PD "Revival of Faith"\r\nTim IT "Sanggar Kitab Suci 2021"\r\nSie Acara PD "Is 24 Hours Enough?"\r\nPIC Games "Independence Day Fellowship"\r\nSie Acara Webinar "Diving Deeper"', '-', 'ingin mengembangkan soft skill dan hard skill, belajar lebih dan menambah pengalaman kepanitiaan, dan memperluas relasi dan wawasan', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/skkk/skkk_181-e24323c0e06180fe72eac0bb26b873bd.png', 'http://bem.petra.ac.id/spetrakuler/oprec/registration/transkrip/transkrip_181-e24323c0e06180fe72eac0bb26b873bd.jpg', 'Ya', 'Ya, 20000', 'Tidak', 892, NULL, 0);
